('070e8836698a4eaeaa08be6cae94ca3b','1dd6c2cd7de54ca7baafbe5ee7f59d97',10,0,'1','2021-03-08 11:34:47','8ce1f0f4dd0e48f184127582cb7b2609','2022-03-14 11:04:40','售后回租',1,'uploadFiles/uploadImgs/20220314/b780cb96f09e4fdebe4062edb967c391.jpg','承租人将自有固定资产出售给租赁公司，然后再从租赁公司租回使用，租赁期满后以名义货价回购此固定资产。','<p><span style=\"color: rgb(36, 36, 36); font-family: &quot;Microsoft YaHei&quot;, Arial; background-color: rgb(255, 255, 255);\">承租人将自有固定资产出售给租赁公司，然后再从租赁公司租回使用，租赁期满后以名义货价回购此固定资产。</span><br/><br/><span style=\"color: rgb(36, 36, 36); font-family: &quot;Microsoft YaHei&quot;, Arial; background-color: rgb(255, 255, 255);\">业务优势：</span><br/><span style=\"color: rgb(36, 36, 36); font-family: &quot;Microsoft YaHei&quot;, Arial; background-color: rgb(255, 255, 255);\">1、盘活存量资产，有效利用现有资产，加速资金再循环，产生资本扩张效应。</span><br/><span style=\"color: rgb(36, 36, 36); font-family: &quot;Microsoft YaHei&quot;, Arial; background-color: rgb(255, 255, 255);\">2、调节现金流，解决企业流动资金困难的问题。</span><br/><span style=\"color: rgb(36, 36, 36); font-family: &quot;Microsoft YaHei&quot;, Arial; background-color: rgb(255, 255, 255);\">3、改善资产负债结构，优化财务指标。</span></p>'),
('074c8b05330544658e2a2d8cd7dc5ad1','12bac24ecb6b455198178c89881d6172',10,0,'8ce1f0f4dd0e48f184127582cb7b2609','2022-03-14 10:56:56','8ce1f0f4dd0e48f184127582cb7b2609','2022-03-14 11:02:46','金融产品担保业务',1,'uploadFiles/uploadImgs/20220314/6c5196f8ba544448a76e16f94b0bcf09.jpg','金融产品担保业务是指委托人在金融产品发行、销售、交易等资金募集过程中，越秀担保为其向金融产品购买方或投资方提供的信用担保或增信服务，在委托人未能履行金融产品约定的相关义务时，按照保函/保证合同承担相应的履约责任。主要产品为私募可转债担保。\r\n','<p><span style=\"color: rgb(36, 36, 36); font-family: &quot;Microsoft YaHei&quot;, Arial; background-color: rgb(255, 255, 255);\">金融产品担保业务是指委托人在金融产品发行、销售、交易等资金募集过程中，越秀担保为其向金融产品购买方或投资方提供的信用担保或增信服务，在委托人未能履行金融产品约定的相关义务时，按照保函/保证合同承担相应的履约责任。主要产品为私募可转债担保。</span><br/><br/><span style=\"color: rgb(36, 36, 36); font-family: &quot;Microsoft YaHei&quot;, Arial; background-color: rgb(255, 255, 255);\">私募可转债担保是指越秀担保对满足准入条件的债券发行人在股权交易所发行私募可转债提供担保，以内评AA级及以上企业提供连带责任保证为反担保措施，对债券发行人的可转债本息兑付行为提供履约保证的融资担保业务。</span></p>'),
('1ad4bb5886ae42098f5a08537eef0326','5784bd02678b4c21b68fcf3de4a4c46b',10,1,'1','2021-03-08 11:17:52','8ce1f0f4dd0e48f184127582cb7b2609','2022-03-14 10:55:32','第三方资产管理',1,'uploadFiles/uploadImgs/20211027/840c7129af304c92a29b618b911f90fd.jpg','以绿色民生工程为基础，大力拓展环保水务、旅游文化、交通物流、健康医疗业务领域，积极推进设备租赁、厂商租赁、长租房租赁等新兴业务，打造全国一流的融资租赁公司。','<p style=\"margin-top: 0px; margin-bottom: 10px; box-sizing: border-box; font-family: &quot;Microsoft YaHei&quot;, Arial; color: rgb(51, 51, 51); white-space: normal; background-color: rgb(255, 255, 255); text-indent: 0em;\"><span style=\"box-sizing: border-box; font-weight: 700;\"><span style=\"box-sizing: border-box; color: rgb(229, 102, 0);\">一、客户的业务需求</span></span></p><p style=\"margin-top: 0px; margin-bottom: 10px; box-sizing: border-box; font-family: &quot;Microsoft YaHei&quot;, Arial; color: rgb(51, 51, 51); white-space: normal; background-color: rgb(255, 255, 255); text-indent: 2em;\"><span style=\"box-sizing: border-box;\">（一）政策性银行、国有商业银行、股份制商业银行、城市商业银行、农商行、农信社、信托公司、财务公司、金融租赁公司等金融机构在广东省的总部及分支机构，为满足自身风险管理、资本管理或其他经营发展需求，需对外转让金融机构不良资产。</span></p><p style=\"margin-top: 0px; margin-bottom: 10px; box-sizing: border-box; font-family: &quot;Microsoft YaHei&quot;, Arial; color: rgb(51, 51, 51); white-space: normal; background-color: rgb(255, 255, 255); text-indent: 2em;\"><span style=\"box-sizing: border-box;\">（二）具有建立法人资格的非金融机构客户为盘活自身存量资产，优化资产配置，促进企业资产结构调整，需对外转让基于生产经营活动、资金往来、投资关系以及其他经营行为所产生的非金融不良资产。</span></p><p style=\"margin-top: 0px; margin-bottom: 10px; box-sizing: border-box; font-family: &quot;Microsoft YaHei&quot;, Arial; color: rgb(51, 51, 51); white-space: normal; background-color: rgb(255, 255, 255); text-indent: 0em;\"><span style=\"box-sizing: border-box; font-weight: 700; text-indent: 38px;\"><span style=\"box-sizing: border-box; color: rgb(229, 102, 0);\">二、服务模式</span></span></p><p style=\"margin-top: 0px; margin-bottom: 10px; box-sizing: border-box; font-family: &quot;Microsoft YaHei&quot;, Arial; color: rgb(51, 51, 51); white-space: normal; background-color: rgb(255, 255, 255); text-indent: 2em;\"><span style=\"box-sizing: border-box;\">广州资产根据市场原则购买转让方的金融和非金融不良资产，通过资产管理、资产重组、并购重组、投资银行、财务顾问及其他专业手段，为金融机构客户有效化解金融风险，提升资本管理水平提供服务；为非金融机构客户盘活存量资产、改善资产结构提供服务。</span></p><p><br/></p><p><br/></p>'),
('2cc7070bb3dc4389ac0cd0fa69a247eb','5784bd02678b4c21b68fcf3de4a4c46b',10,0,'1','2021-10-27 15:35:24','8ce1f0f4dd0e48f184127582cb7b2609','2022-03-14 10:55:49',' 贷款申请流程',0,'uploadFiles/uploadImgs/20211027/af69fead720547f7ac420d14ff52a269.jpg','首先，有试点意向的区（县）政府向市金融办递交试点申请书，阐明试点工作方案并承诺承担风险防范与处置责任。','<p>首先，有试点意向的区（县）政府向市金融办递交试点申请书，阐明试点工作方案并承诺承担风险防范与处置责任。</p><p>其次，区（县）政府，对本区（县）符合相关条件及有申报意向的小额贷款公司主要发起人进行筛选。</p><p>最后，经筛选的小额贷款公司主要发起人向所在区（县）政府递交小额贷款公司设立申请材料，区（县）政府完成预审后上报市金融办复审。小额贷款公司申请人凭市<a target=\"_blank\" href=\"https://baike.baidu.com/item/%E9%87%91%E8%9E%8D%E5%8A%9E\" style=\"color: rgb(19, 110, 194); text-decoration-line: none;\">金融办</a>批准批文，依法向<a target=\"_blank\" href=\"https://baike.baidu.com/item/%E5%B7%A5%E5%95%86%E8%A1%8C%E6%94%BF%E7%AE%A1%E7%90%86/11001691\" style=\"color: rgb(19, 110, 194); text-decoration-line: none;\">工商行政管理</a>部门办理登记手续并领取营业执照，并在5个工作日内向当地公安机关、<a target=\"_blank\" href=\"https://baike.baidu.com/item/%E9%93%B6%E7%9B%91%E5%B1%80\" style=\"color: rgb(19, 110, 194); text-decoration-line: none;\">银监局</a>和人行分行报送相关资料。</p><p><a class=\"lemma-anchor para-title\" style=\"color: rgb(19, 110, 194); position: absolute; top: -50px;\"></a><a class=\"lemma-anchor \" style=\"color: rgb(19, 110, 194); position: absolute; top: -50px;\"></a><a class=\"lemma-anchor \" style=\"color: rgb(19, 110, 194); position: absolute; top: -50px;\"></a><a class=\"lemma-anchor \" style=\"color: rgb(19, 110, 194); position: absolute; top: -50px;\"></a></p><h3 class=\"title-text\" style=\"margin: 0px; padding: 0px; font-size: 18px; font-weight: 400;\">申请成立条件</h3><p>1. 有符合规定的<a target=\"_blank\" href=\"https://baike.baidu.com/item/%E7%AB%A0%E7%A8%8B/29457\" style=\"color: rgb(19, 110, 194); text-decoration-line: none;\">章程</a>。</p><p>2. 发起人或出资人应<a target=\"_blank\" href=\"https://baike.baidu.com/item/%E7%AC%A6%E5%90%88/33673\" style=\"color: rgb(19, 110, 194); text-decoration-line: none;\">符合</a><a target=\"_blank\" href=\"https://baike.baidu.com/item/%E8%A7%84%E5%AE%9A/1104611\" style=\"color: rgb(19, 110, 194); text-decoration-line: none;\">规定</a>的条件。</p><p>3. 小额贷款公司组织形式为<a target=\"_blank\" href=\"https://baike.baidu.com/item/%E6%9C%89%E9%99%90%E8%B4%A3%E4%BB%BB%E5%85%AC%E5%8F%B8\" style=\"color: rgb(19, 110, 194); text-decoration-line: none;\">有限责任公司</a>或<a target=\"_blank\" href=\"https://baike.baidu.com/item/%E8%82%A1%E4%BB%BD%E6%9C%89%E9%99%90%E5%85%AC%E5%8F%B8\" style=\"color: rgb(19, 110, 194); text-decoration-line: none;\">股份有限公司</a>。有限责任公司应由50个以下<a target=\"_blank\" href=\"https://baike.baidu.com/item/%E8%82%A1%E4%B8%9C\" style=\"color: rgb(19, 110, 194); text-decoration-line: none;\">股东</a>出资设立；股份有限公司应有2－200名发起人，其中须有半数以上的发起人在中国境内有住所。</p><p>4. 小额贷款公司的注册资本来源应真实合法，全部为实收货币资本，由出资人或发起人一次足额缴纳。有限责任公司的注册资本不得低于500万元，股份有限公司的注册资本不得低于1000万元。单一自然人、<a target=\"_blank\" href=\"https://baike.baidu.com/item/%E4%BC%81%E4%B8%9A%E6%B3%95%E4%BA%BA\" style=\"color: rgb(19, 110, 194); text-decoration-line: none;\">企业法人</a>、其他社会组织及其关联方持有的股份，不得超过小额贷款公司注册资本总额的10%。</p><p>5. 有符合任职资格条件的<a target=\"_blank\" href=\"https://baike.baidu.com/item/%E8%91%A3%E4%BA%8B/2300631\" style=\"color: rgb(19, 110, 194); text-decoration-line: none;\">董事</a>和<a target=\"_blank\" href=\"https://baike.baidu.com/item/%E9%AB%98%E7%BA%A7%E7%AE%A1%E7%90%86%E4%BA%BA%E5%91%98/10598481\" style=\"color: rgb(19, 110, 194); text-decoration-line: none;\">高级管理人员</a>。</p><p>6. 有具备相应专业知识和从业经验的工作人员。</p><p>7. 有必需的组织机构和管理制度。</p><p>8.有符合要求的营业场所、安全防范措施和与业务有关的其他设施。</p><p>9.省政府金融办规定的其他审慎性条件。</p><p><a class=\"lemma-anchor para-title\" style=\"color: rgb(19, 110, 194); position: absolute; top: -50px;\"></a><a class=\"lemma-anchor \" style=\"color: rgb(19, 110, 194); position: absolute; top: -50px;\"></a><a class=\"lemma-anchor \" style=\"color: rgb(19, 110, 194); position: absolute; top: -50px;\"></a><a class=\"lemma-anchor \" style=\"color: rgb(19, 110, 194); position: absolute; top: -50px;\"></a></p><h3 class=\"title-text\" style=\"margin: 0px; padding: 0px; font-size: 18px; font-weight: 400;\">申请注意事项</h3><p>在线申请前，请确认您是否符合以下<a target=\"_blank\" href=\"https://baike.baidu.com/item/%E6%97%A0%E6%8A%B5%E6%8A%BC%E5%B0%8F%E9%A2%9D%E8%B4%B7%E6%AC%BE/4509999\" style=\"color: rgb(19, 110, 194); text-decoration-line: none;\">无抵押小额贷款</a>申请条件：25周岁到55周岁（部分客户要求29周岁到55周岁）</p><p>单位连续工作满3个月，部分客户需满6个月</p><p>稳定的职业和收入</p><p>申请程序简单便捷：避免繁冗的评估、担保手续；无须抵押任何资产凭证。</p><p><br/></p>'),
('3832beae3b274a8fbe41c1b190701743','5784bd02678b4c21b68fcf3de4a4c46b',10,0,'1','2021-10-27 15:35:12','8ce1f0f4dd0e48f184127582cb7b2609','2022-03-14 10:55:43','贷款金融政策',0,'uploadFiles/uploadImgs/20211027/5ec8aabd72254080bedb6a79f65af971.jpg','小额贷款公司应遵守国家法律、行政法规，执行国家金融方针和政策，执行金融企业财务准则和会计制度，依法接受各级政府及相关部门的监督管理。','<p>小额贷款公司应遵守国家法律、行政法规，执行国家金融方针和政策，执行金融企业财务准则和会计制度，依法接受各级政府及相关部门的监督管理。</p><p>小额贷款公司应执行国家金融方针和政策，在法律、法规规定的范围内开展业务，自主经营，自负盈亏，自我约束，自担风险，其合法的经营活动受法律保护，不受任何单位和个人的干涉。</p><p><br/></p>'),
('38976e6c9f7f4e08b182ef1ddafdb2aa','f4a8eb519aaf451d94e469950aa933b8',10,0,'1','2021-03-08 11:17:19','8ce1f0f4dd0e48f184127582cb7b2609','2022-03-14 11:01:06','资产管理业务',1,'uploadFiles/uploadImgs/20220314/3be365f5669e40548301689b0ed6e9e1.jpg','广州期货拥有定向发行资产管理计划以及集合资产管理计划业务许可，拥有参与新股IPO网下询价与申购业务、银行间债券市场交易的资格。公司发行的资管产品类型丰富，包括FOF、MOM、一对一、一对多、纯期货、纯证券、混合型、管理型、结构化等，品种涵盖市场主流产品。','<p style=\"margin-top: 0px; margin-bottom: 10px; box-sizing: border-box; font-family: &quot;Microsoft YaHei&quot;, Arial; color: rgb(51, 51, 51); white-space: normal; background-color: rgb(255, 255, 255); text-indent: 0em;\"><span style=\"box-sizing: border-box; font-weight: 700;\"><span style=\"box-sizing: border-box; color: rgb(229, 102, 0);\"></span></span><span style=\"color: rgb(36, 36, 36); font-family: &quot;Microsoft YaHei&quot;, Arial; background-color: rgb(255, 255, 255);\">广州期货拥有定向发行资产管理计划以及集合资产管理计划业务许可，拥有参与新股IPO网下询价与申购业务、银行间债券市场交易的资格。公司发行的资管产品类型丰富，包括FOF、MOM、一对一、一对多、纯期货、纯证券、混合型、管理型、结构化等，品种涵盖市场主流产品。</span><br/><br/><span style=\"color: rgb(36, 36, 36); font-family: &quot;Microsoft YaHei&quot;, Arial; background-color: rgb(255, 255, 255);\">业务优势：广州期货资产管理部作为资产管理业务的专职部门，拥有专业、稳健的营运团队，建立严密的风险管理体系，制定严格的后台运作管理制度，通过先进可靠的信息技术系统，保证各项投资、研究活动高效稳健运行，保障客户委托资产的安全和增值。</span></p><p><br/></p>'),
('3bba125c07a94bc48f58466c3f870d13','f4a8eb519aaf451d94e469950aa933b8',10,1,'1','2021-10-13 09:47:02','1','2021-10-27 15:33:28','这是期货业务',0,'','这是期货业务','<p>这是期货业务</p>'),
('3becc8bb2497427ebb66c6e9ac1dc220','f4a8eb519aaf451d94e469950aa933b8',10,0,'1','2021-03-08 11:17:05','8ce1f0f4dd0e48f184127582cb7b2609','2022-03-14 11:00:40','期货期权经纪业务',1,'uploadFiles/uploadImgs/20220314/6ce55e4734ba47d399c6a75b8e23fd82.jpg','期货期权经纪业务主要是为个人、企业及专业投资机构等客户提供代理期货交易与结算的中间业务，公司接受客户委托并按照客户指令进行期货交易并收取手续费。','<p style=\"box-sizing: border-box; font-family: &quot;Microsoft YaHei&quot;, Arial; margin-top: 0px; margin-bottom: 10px; color: rgb(51, 51, 51); white-space: normal; background-color: rgb(255, 255, 255); text-indent: 0em;\"><span style=\"box-sizing: border-box;font-weight: 700\"><span style=\"box-sizing: border-box;color: rgb(229, 102, 0)\"></span></span><span style=\"color: rgb(36, 36, 36); font-family: &quot;Microsoft YaHei&quot;, Arial; background-color: rgb(255, 255, 255);\">期货期权经纪业务主要是为个人、企业及专业投资机构等客户提供代理期货交易与结算的中间业务，公司接受客户委托并按照客户指令进行期货交易并收取手续费。</span><br/><br/><span style=\"color: rgb(36, 36, 36); font-family: &quot;Microsoft YaHei&quot;, Arial; background-color: rgb(255, 255, 255);\">业务优势：广州期货立足粤港澳大湾区，基本形成了以华南地区为中心，覆盖华北、华东、华中和西南地区经济中心城市的全国性营销网络，基本辐射了大宗商品核心产销区，可即时响应客户需求、近距离为客户服务。</span><span style=\"box-sizing: border-box\"></span></p><p><br/></p>'),
('5dabf32f8f6e403fb78f2a3b3df83f68','12bac24ecb6b455198178c89881d6172',10,0,'8ce1f0f4dd0e48f184127582cb7b2609','2022-03-14 10:56:33','8ce1f0f4dd0e48f184127582cb7b2609','2022-03-14 11:02:22','企业融资担保业务',1,'uploadFiles/uploadImgs/20220314/0ba11af55fbd4d4cb9a6844e083ea670.png','越秀担保以保证的方式为国内符合产业政策的中小企业向金融机构申请贷款提供担保，主要产品为核心企业商票保。','<p><span style=\"color: rgb(36, 36, 36); font-family: &quot;Microsoft YaHei&quot;, Arial; background-color: rgb(255, 255, 255);\">越秀担保以保证的方式为国内符合产业政策的中小企业向金融机构申请贷款提供担保，主要产品为核心企业商票保。</span><br/><br/><span style=\"color: rgb(36, 36, 36); font-family: &quot;Microsoft YaHei&quot;, Arial; background-color: rgb(255, 255, 255);\">核心企业商票保指借款企业持有越秀担保授信准入的核心企业及其下属子公司等主体开立的电子商业承兑汇票，并以持有的电子商业承兑汇票为反担保措施，经越秀担保对借款企业增信担保后，向越秀担保合作银行申请票据贴现或流动资金贷款的融资担保业务。</span></p>'),
('673ddd12b4384ccf9370997aa330e96a','555753104731486fb44d9c42a5abc45b',10,0,'1','2021-03-08 11:16:46','8ce1f0f4dd0e48f184127582cb7b2609','2022-03-14 10:59:45','固定收益业务',1,'uploadFiles/uploadImgs/20220314/924b9fcffe894eb8a9a0ea3262fae7dc.jpg','根据企业客户意向融资规模、融资成本和融资期限等具体需要，综合运用自身在功能、资金、经验等方面的专业优势，通过资管计划、私募基金、可转债等方式为企业客户灵活设计交易结构，多渠道解决客户发展资金不足的问题。','<p><span style=\"color: rgb(36, 36, 36); font-family: &quot;Microsoft YaHei&quot;, Arial; background-color: rgb(255, 255, 255);\">广州资产根据企业客户意向融资规模、融资成本和融资期限等具体需要，综合运用自身在功能、资金、经验等方面的专业优势，通过资管计划、私募基金、可转债等方式为企业客户灵活设计交易结构，多渠道解决客户发展资金不足的问题。</span></p>'),
