('76e2244f370b4e72999c0ce4a62a55c9','f47af9b07bf24f44a86beac3068792eb',10,0,'1','2021-03-08 11:35:28','8ce1f0f4dd0e48f184127582cb7b2609','2022-03-14 11:09:18','母基金投资业务',1,'uploadFiles/uploadImgs/20220314/f15fe5b67e89409292233dda177ab62a.jpg','越秀产业基金母基金投资实施“头部GP的持续LP”策略，已投资中信产业基金、鼎晖投资、金石投资、中金资本、广汽资本、国投创合、德福资本等优秀基金管理人管理的基金，子基金已投项目业绩表现良好，多个项目已登陆资本市场实现优异回报。','<p><span style=\"color: rgb(36, 36, 36); font-family: &quot;Microsoft YaHei&quot;, Arial; background-color: rgb(255, 255, 255);\">越秀产业基金母基金投资实施“头部GP的持续LP”策略，已投资中信产业基金、鼎晖投资、金石投资、中金资本、广汽资本、国投创合、德福资本等优秀基金管理人管理的基金，子基金已投项目业绩表现良好，多个项目已登陆资本市场实现优异回报。</span></p>'),
('7f81a962f09b48bbb0cf9cfaae73a733','1dd6c2cd7de54ca7baafbe5ee7f59d97',10,0,'1','2021-03-08 11:34:28','8ce1f0f4dd0e48f184127582cb7b2609','2022-03-14 11:04:16','直接融资租赁',1,'uploadFiles/uploadImgs/20220314/a146f7b07f934a1c94924df062b5318b.jpg','租赁公司根据承租人的要求和选择购入承租人所需固定资产（设备），再租赁给承租人使用。','<h3 class=\"\" style=\"box-sizing: border-box; font-variant-numeric: normal; font-variant-east-asian: normal; font-weight: normal; font-stretch: normal; font-size: 26px; line-height: 40px; font-family: &quot;Microsoft YaHei&quot;, Arial; color: rgb(53, 53, 53); margin: 0px 0px 10px; padding: 0px 0px 5px; min-height: 46px; border-bottom: 1px solid rgb(236, 236, 236); white-space: normal; background-color: rgb(255, 255, 255);\">直接融资租赁</h3><p style=\"box-sizing: border-box; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 28px; font-family: &quot;Microsoft YaHei&quot;, Arial; margin-top: 0px; margin-bottom: 10px; color: rgb(36, 36, 36); min-height: 260px; white-space: normal; background-color: rgb(255, 255, 255);\">租赁公司根据承租人的要求和选择购入承租人所需固定资产（设备），再租赁给承租人使用。<br/><br/>业务优势：<br/>1、企业仅付少部分的资金，即可获得新设备使用权，以产生的收益作为还款来源，增加投资速度，实现企业快速扩张。<br/>2、具有加速折旧和递延纳税的作用。<br/>3、租金设计灵活，匹配新项目现金流，减少承租人财务负担。<br/>4、为承租人提供中长期融资新渠道。</p><p><br/></p>'),
('7fd753f5b5d143e583fc713c125c3861','5784bd02678b4c21b68fcf3de4a4c46b',10,1,'1','2021-03-08 11:17:33','8ce1f0f4dd0e48f184127582cb7b2609','2022-03-14 10:55:29','不良资产经营',1,'uploadFiles/uploadImgs/20211027/b441699c0ef94b719a5c837b928a3afe.jpg','以绿色民生工程为基础，大力拓展环保水务、旅游文化、交通物流、健康医疗业务领域，积极推进设备租赁、厂商租赁、长租房租赁等新兴业务，打造全国一流的融资租赁公司。','<p style=\"box-sizing: border-box; font-family: &quot;Microsoft YaHei&quot;, Arial; margin-top: 0px; margin-bottom: 10px; color: rgb(51, 51, 51); white-space: normal; background-color: rgb(255, 255, 255); text-indent: 0em;\"><span style=\"box-sizing: border-box;font-weight: 700\"><span style=\"box-sizing: border-box;color: rgb(229, 102, 0)\">一、客户的业务需求</span></span></p><p style=\"box-sizing: border-box;font-family: &#39;Microsoft YaHei&#39;, Arial;margin-top: 0px;margin-bottom: 10px;color: rgb(51, 51, 51);white-space: normal;background-color: rgb(255, 255, 255);text-indent: 2em\"><span style=\"box-sizing: border-box\">（一）政策性银行、国有商业银行、股份制商业银行、城市商业银行、农商行、农信社、信托公司、财务公司、金融租赁公司等金融机构在广东省的总部及分支机构，为满足自身风险管理、资本管理或其他经营发展需求，需对外转让金融机构不良资产。</span></p><p style=\"box-sizing: border-box;font-family: &#39;Microsoft YaHei&#39;, Arial;margin-top: 0px;margin-bottom: 10px;color: rgb(51, 51, 51);white-space: normal;background-color: rgb(255, 255, 255);text-indent: 2em\"><span style=\"box-sizing: border-box\">（二）具有建立法人资格的非金融机构客户为盘活自身存量资产，优化资产配置，促进企业资产结构调整，需对外转让基于生产经营活动、资金往来、投资关系以及其他经营行为所产生的非金融不良资产。</span></p><p style=\"box-sizing: border-box; font-family: &quot;Microsoft YaHei&quot;, Arial; margin-top: 0px; margin-bottom: 10px; color: rgb(51, 51, 51); white-space: normal; background-color: rgb(255, 255, 255); text-indent: 0em;\"><span style=\"box-sizing: border-box;font-weight: 700;text-indent: 38px\"><span style=\"box-sizing: border-box;color: rgb(229, 102, 0)\">二、服务模式</span></span></p><p style=\"box-sizing: border-box;font-family: &#39;Microsoft YaHei&#39;, Arial;margin-top: 0px;margin-bottom: 10px;color: rgb(51, 51, 51);white-space: normal;background-color: rgb(255, 255, 255);text-indent: 2em\"><span style=\"box-sizing: border-box\">广州资产根据市场原则购买转让方的金融和非金融不良资产，通过资产管理、资产重组、并购重组、投资银行、财务顾问及其他专业手段，为金融机构客户有效化解金融风险，提升资本管理水平提供服务；为非金融机构客户盘活存量资产、改善资产结构提供服务。</span></p><p><br/></p>'),
